import { useRouteError } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";

const ErrorPage = () => {
  let error = useRouteError();
  let message = error.data.message;
  let status = error.status;

  return (
    <>
      <MainNavigation />
      <p>{status}</p>
    </>
  );
};

export default ErrorPage;
